import { Routes, Route } from 'react-router-dom';

import Home from './routes/home/home.component';


const Navigation = () => {
  return (
    <div>
      <div>
        <h1>I am the navigation bar</h1>
      </div>
    </div>
  )
}

const Shop = () => {
  return (
    <h1>This is the Shop Page!</h1>
  )
}

const App = () => {
  return (
    <Routes>
      <Route path='/home' element={<Home />} >
        <Route path='shop' element={<Shop />} />
      </Route>
    </Routes>
  );
};

export default App;
